import { ReactComponent as IconVK } from "./vk.svg";
import { ReactComponent as IconFacebook } from "./facebook.svg";
import { ReactComponent as IconMail } from "./mail.svg";
import { ReactComponent as IconInstagram } from "./instagram.svg";
import { ReactComponent as IconTwitter } from "./twitter.svg";
import { ReactComponent as IconTelegram } from "./telegram.svg";
import { ReactComponent as IconYoutube } from "./youtube.svg";

export {
  IconVK,
  IconFacebook,
  IconMail,
  IconInstagram,
  IconTwitter,
  IconTelegram,
  IconYoutube,
};
